import React, { Component } from 'react';
import {Cards, Charts, CountryPicker} from './Components';
class App extends Component {
    render() {
        return (
            <div className={styles.container}>
<Cards />
<CountryPicker />
<Charts />
            </div>
        )
    }
}
export default App;
